import React from 'react'
import Navbar from './Navbar'

const MainPage = () => {
  return (
    <>
        {/* Heading */}
        <section>
            <Navbar />
        </section>

        {/* Sidebar */}
        <section>
            <div className="grid grid-cols-11">
                <div className="col-span-2 bg-slate-900 h-screen pl-2"></div>
                <div className="col-span-9 bg-amber-50 h-screen pl-2"></div>
            </div>
        </section>
    </>
  )
}

export default MainPage
